/*  Changes since the last version:
 *
 *  If we can't find a .o file under the N_OBJ path, look for it in the
 *  same places we look for source files.
 *  Switch from block editing cursor to narrow marker bar.
 *  Under Solaris 2, check for execute permission before execing the target.
 *  Fix parsing of integer constants in the C interpreter.
 *  Automatically display source when a single stack object is selected.
 *  Minor updates to the man page.
 *  
 *  ao_symscan.c 1.3:
 *      make_stf(): stf_objpath field replaced by stf_objpath_hint and stf_objname.
 *      scan_symtab(): Take extra name parameter - needed when called from
 *      scan_dot_o_file().
 *      note_ofile_function(): Take extra name parameter (see above).
 *      adjust_fil_vars_addr_base(): Skip files with stf NULL.
 *  
 *  ao_symscan.h 1.2:
 *      Track change to scan_symtab() prototype.
 *  
 *  ao_procfs.c 1.3:
 *      procfs_create_child(): Don't attempt to vfork() and exec() if access()
 *      reports that the target is not executable.
 *  
 *  ao_elfsym.c 1.3:
 *      scan_index_syms(): Don't try to set *p_mainfunc_name if it is NULL.
 *        Only look at first N_OPT after an N_SO.  Store N_OBJ path_hint and
 *        name seperately, so scan_dot_o_file_symtab() can try various places
 *        for the .o file.
 *      setup_ofile_symio(): Make copy of el->path, as it is now temporary.
 *      scan_dot_o_file_symtab(): Locate .o files based on the path hint and the
 *        list of source file dirs.
 *      elf_scan_then_setup_symio(): Use the source file stf when passed a
 *        header file fil struct.
 *  
 *  srcpath.c 1.3:
 *      srcpath_resolve_path(): New public function to search for a file in
 *      the same list of directories we search for source files.  Used to
 *      locate .o files under Solaris 2.
 *  
 *  srcpath.h 1.2:
 *      Add prototype for new function srcpath_resolve_path().
 *  
 *  cx_wsym.c 1.4:
 *      enter_type(): Change keylen parameter from int to size_t to track
 *        change to hash_apply().
 *  
 *  ao_text.c 1.6:
 *      scan_ao_symtab(): Track change to scan_symtab().
 *  
 *  ao_syms.h 1.4:
 *      stf_t: Replace stf_objpath member with stf_objpath_hint and
 *        stf_objname.  This is so ao_elfsym.c can locate .o files more
 *        intelligently.
 *  
 *  ci_lex.c 1.24:
 *      yylex(): Avoid silently getting the wrong value for integer constants
 *        like 0xffffffff.  C integer lexing code still needs work though.
 *  ci_lex.c 1.25:
 *      ci_lex(): Call new function convert_number() rather than strtoul(), as
 *        SunOS 4.X doesn't have strtoul() (plus, we can do better error
 *        messages).
 *  
 *  ui_layout.c 1.32:
 *      display_area_input(): Automatically display source when a single stack
 *        object is selected.
 *  
 *  obj_stack.c 1.21:
 *      maybe_show_stack_entry_source(): New function to automatically display
 *        source when a single stack object is selected.
 *  
 *  obj_stack.h 1.12:
 *      Add prototype for new function maybe_show_stack_entry_source().
 *  
 *  doc/ups.man 1.17:
 *      Describe xterm-like clicking in the scroll bar.
 *      Describe new meanings for the source window Up and Down menu items.
 *      s/editing cursor/marker bar/ throughout.
 *  
 */

